import React from 'react';
import Layout from '../../components/Layout';
import { contentContainer } from './media.module.scss';

const Media = () => {
  return (
    <Layout>
      <div className={contentContainer}>
        <h1>Media.</h1>
      </div>
    </Layout>
  );
};

export default Media;
